import React from 'react';
import s from './NotFound.module.css'
import {NavLink} from "react-router-dom";
import DailyRoutine from "../DailyRoutine/DailyRoutine";

const Dialog = (props) => {
    return (
    <div>
        <NavLink to="/dialogs/1">Romio</NavLink>
    </div>
)
}

const NotFound = () => {
    return(
        <div>
            <h3><Dialog /></h3>
        </div>
    )
}

export default NotFound;
